  CREATE OR REPLACE FORCE VIEW "ZAZ"."NOBUGPROJECT" ("PROJECTTITLE") AS 
  SELECT projecttitle
  FROM Project p
    RIGHT JOIN Bug b ON b.bugprojectid = p.projectid
  WHERE b.bugprojectid IS NULL;
