  CREATE OR REPLACE FUNCTION "ZAZ"."BUGCOUNT" 
  RETURN number
IS
  bug_count NUMBER;
BEGIN
  SELECT COUNT(*) INTO bug_count FROM Bug WHERE bugfixerid = 0;
  RETURN bug_count;
END;

CREATE OR REPLACE FUNCTION Min3(
  a IN NUMBER,
  b IN NUMBER,
  c IN NUMBER)
  RETURN NUMBER
IS
BEGIN
  if a < b THEN
    IF a < c THEN
      return a;
    END IF;
    IF c < b THEN
      return c;
    END IF;
  END IF;
  return b;
END;

